import Pokemon from "../Img/Pokemon.png";
import "./Card.css";
const Card = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6 col-lg-4">a</div>
        <div className="col-md-6 col-lg-4">b</div>
        <div className="col-md-6 col-lg-4">c</div>
      </div>
    </div>
  );
};

export default Card;
